const ImageCard = ({imageItem, title, text}) => {

    return (
        <div>
            <img src= {imageItem}></img>
                <div>
                    <h3>{title}</h3>
                    <p>{text}</p>
                </div>
            </div>
    );
}

export default ImageCard;
